import React, { Component, text } from "react";
import { Container, Row, Col } from 'react-bootstrap';


class Quality extends Component {
  render() {
    return (
      <Container className="text-center">
        <h2 style={{ marginBottom: "20px" }}>{this.props.title}</h2>
        <Row>
          <Col>
            <img style={{ width: "100%", marginBottom: "15px" }} src={this.props.image} />
            <p>{this.props.desc}</p>
          </Col>
          {this.props.image2 || this.props.desc2 ?
            <Col>
              {this.props.image2 ? <img style={{ width: "100%", marginBottom: "15px"  }} src={this.props.image2} /> : null}
              {this.props.desc2 ? <p>{this.props.desc2}</p> : null }
            </Col> : null}
        </Row>
      </Container>
    );
  }
}

export default Quality;
